from collections import defaultdict
from pprint import pprint
from math import comb

class Solution:
    def countTrapezoids(self, points: list[list[int]]) -> int:
        d = defaultdict(int)
        mod = 1000000007
        ans = s = 0
        for x, y in points:
            d[y] += 1
        for c in d:
            k = d[c] * (d[c] - 1) // 2
            ans += s * k
            s += k
        return ans % mod


